const Duummy_navbar = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const Navbar = () => {
  return (
    <div>
      <p>Booking Website</p>
      <div>
        <button>Register</button>
        <button>Login</button>
      </div>

      <div></div>
    </div>
  );
};

export default Navbar;
